import React from 'react';
import { ClassNames } from 'helpers/ClassNames/ClassNames';
import cls from './SigninPopup.module.css';
import { PopupWrapper } from 'components/PopupWrapper/PopupWrapper';
import { PopupFormRow } from 'components/PopupFormRow/PopupFormRow';
import { Cross } from 'UI/Cross/Cross';
import { Button, ButtonTheme } from 'UI/Button/Button';

export const SigninPopup = (props) => {
    const { className } = props;

    return (
        <PopupWrapper>
            <div className={ClassNames(cls.signinPopup, {}, [className])}>
                <Cross size={23} style={{top: '36.11px', right: '50.7px'}} />
                <h1 className={cls.title}>
                    Вход
                </h1>
                <PopupFormRow label={"Почта"} placeholder={'ivanov@mail.ru'} />
                <PopupFormRow  label={'Пароль'} placeholder={'ivanov11'} />
                <Button theme={ButtonTheme.DARK} >Войти</Button>
            </div>
        </PopupWrapper>
 );
}
